    false,nt"url": null,nt"notes": "The Service is proposing to expand the
    acquisition boundary of the Arapaho National Wildlife Refuge in order to protect
    important migratory bird habitat and key wintering grounds for the greater sage
    grouse. This document discusses the proposal to accept, in fee title, a donation
    of the Chandler Ranch. The Chandler Ranch includes nearly 2,250 acres of deeded
    land with additional BLM grazing leases on adjoining BLM lands. The addition of
    this area into the refuge system will enhance and ensure protection of habitats
    valuable to migratory birds that utilize North Park.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
